import {testClick} from "@/functions";


const LogIn = () => {
  return (
    <div className="??">
      <h1>LOGIN GO HERE</h1>

      <div>
        <label for="usernameInput">Username:</label>
        <input type="text" id="usernameInput" name="usernameInput"></input>
      </div>

      <br></br>
      <br></br>

      <div>
        <label for="profileInput">Profile:</label>
        <input type="text" id="profileInput" name="profileInput"></input>
      </div>


      <br></br>
      <br></br>

      <button class="buttonS1" onclick={testClick}> LOG IN </button>

    </div>
  );
}

export default LogIn;
